import "./TeamBuilder.css";
import EmptyTeamSlot from "./EmptyTeamSlot";
import FilledTeamSlot from "./FilledTeamSlot";

const TeamBuilder = ({currentTeam}) => {
    return (
        <div className={"teamRow"}>
            {currentTeam[0] ?
                <FilledTeamSlot pokemon={currentTeam[0]}/>
            :
            <EmptyTeamSlot/>
            }
            {currentTeam[1] ?
                <FilledTeamSlot pokemon={currentTeam[1]}/>
                :
                <EmptyTeamSlot/>

            }
            {currentTeam[2] ?
                <FilledTeamSlot pokemon={currentTeam[2]}/>
                :
                <EmptyTeamSlot/>

            }
            {currentTeam[3] ?
                <FilledTeamSlot pokemon={currentTeam[3]}/>
                :
                <EmptyTeamSlot/>

            }
            {currentTeam[4] ?
                <FilledTeamSlot pokemon={currentTeam[4]}/>
                :
                <EmptyTeamSlot/>

            }
            {currentTeam[5] ?
                <FilledTeamSlot pokemon={currentTeam[5]}/>
                :
                <EmptyTeamSlot/>

            }
        </div>

    );
}

export default TeamBuilder;
